import React from "react";
import { Header, Footer } from "../components/index";

const HeatMap = () => {
  return (
    <div>
      <Header />

      <div className="row">
        <div className="col-12">
          <div className="tabs p-3"></div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default HeatMap;
